import ExpenseItem from "./Component/ExpenseItem";
function App() {
  const Expense = [{
    title: "Toilt paper",
    amount: 94, 
    date: new Date(1997, 2, 28)
  },
  {
    title: "Car Insurance",
    amount: 100,
    date: new Date(1997, 2, 28)
  },
  {
    title: "New Table",
    amount: 120, 
    date: new Date(1997, 2, 28)
  }]
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title={Expense[0].title}amount={Expense[0].amount}data={Expense[0].date}></ExpenseItem>
      <ExpenseItem title={Expense[1].title}amount={Expense[1].amount}data={Expense[1].date}></ExpenseItem>
      <ExpenseItem title={Expense[2].title}amount={Expense[2].amount}data={Expense[2].date}></ExpenseItem>
    </div>
  );
}

export default App;
